import React from 'react';

export default class NewListInput extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            inputVal: ''
        }
    }
    render() {
        return (
            <div className="new-list-wrapper">
                <input type="text" placeholder="Create New List..." />
                <button>Create</button>
            </div>
        )
    }
}
